import './Login.css';
import NavigationBar from './NavigationBar';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Home() {
    return(
        <div fluid>
            <NavigationBar />
            <Container fluid>
                <Row>
                    <Col>
                        <h1>Home</h1>
                    </Col>
                </Row>
            </Container>
        </div>
